import React, { Component } from "react";
import "./App.css";
import "font-awesome/css/font-awesome.min.css";

class App extends Component {
  render() {
    return (
      <div className="App">
        <h1 className="App-header">
          Log in page
        </h1>{" "}
        <div className="userIcon">
          <i class="fa-4x fa-user-circle"></i>
          </div>
      </div>
    );
  }
}
export default App;
